features:
languagesystem DFLT dflt;
languagesystem cyrl dflt;
languagesystem grek dflt;
languagesystem grek IPPH;
languagesystem grek APPH;
languagesystem latn dflt;
languagesystem latn CAT;
languagesystem latn MOL;
languagesystem latn NAV;
languagesystem latn ROM;
languagesystem latn MAH;
languagesystem latn IPPH;
languagesystem latn APPH;
languagesystem cyrl SRB;
languagesystem cyrl MKD;
@Paren.right = [braceright bracketright parenright];
@CombiningTopAccents = [acutecomb brevecomb caroncomb circumflexcomb dieresiscomb dotaccentcomb gravecomb hungarumlautcomb macroncomb ringcomb tildecomb];
# automatic
# Prefix: Languagesystems
feature ccmp {
    # zero.slash alternate
    lookup latnSoftDot {
        lookupflag UseMarkFilteringSet @CombiningTopAccents;
        sub [i j]' @CombiningTopAccents by [idotless jdotless];
    } latnSoftDot;

    lookup latnLigatures {
        # The following WAS in the liga, but I think it belongs here.
        #sub O ogonekcomb macron by Oogonekmacron;
        #sub o ogonekcomb macron by oogonekmacron;
        #sub o.sc ogonekcomb.sc macron.sc by oogonekmacron.sc;
        #sub o.sc ogonekcomb.sc by oogonek.sc;
        sub A ogonekcomb by Aogonek;
        sub a ogonekcomb by aogonek;
        sub E ogonekcomb by Eogonek;
        sub e ogonekcomb by eogonek;
        sub I ogonekcomb by Iogonek;
        sub i ogonekcomb by iogonek;
        sub U ogonekcomb by Uogonek;
        sub u ogonekcomb by uogonek;
        # IPA
    } latnLigatures;

    script latn;
    language dflt;
    lookup latnSoftDot;
    lookup latnLigatures;
    language CAT;
    lookup latnSoftDot;
    lookup latnLigatures;
    language MAH;
    lookup latnSoftDot;
    lookup latnLigatures;
    language MOL;
    lookup latnSoftDot;
    lookup latnLigatures;
    language NAV;
    lookup latnSoftDot;
    lookup latnLigatures;
    language ROM;
    lookup latnSoftDot;
    lookup latnLigatures;
    script grek;
    # Greek
    script cyrl;
    #sub afii10103 by afii10103dotless;
    #sub afii10105 by afii10105dotless;
} ccmp;

feature aalt {
    feature ccmp;
    feature locl;
    feature subs;
    feature sups;
    feature numr;
    feature dnom;
    feature frac;
    feature ordn;
    feature lnum;
    feature pnum;
    feature tnum;
    feature onum;
    feature c2sc;
    feature smcp;
    feature case;
    feature rtlm;
    feature zero;
    feature ss03;
    feature salt;
} aalt;

feature locl {
    script latn;
    language NAV;
    language MOL;
    sub Scedilla by Scommaaccent;
    sub scedilla by scommaaccent;
    language ROM;
    sub Scedilla by Scommaaccent;
    sub scedilla by scommaaccent;
    language MAH;
    language CAT;
    language IPPH;
    language APPH;
    script cyrl;
    language SRB;
    language MKD;
    script grek;
    language IPPH;
    language APPH;
} locl;

feature ordn {
    # automatic
    sub [zero one two three four five six seven eight nine] [A a]' by [ordfeminine ordfeminine];
    sub [zero one two three four five six seven eight nine] [O o]' by [ordmasculine ordmasculine];
} ordn;

feature kern {
    lookupflag UseMarkFilteringSet [circumflexcomb caroncomb dieresiscomb tildecomb macroncomb brevecomb];
    pos idotless [circumflexcomb caroncomb dieresiscomb tildecomb macroncomb brevecomb]' 50 @Paren.right;
    # Automatic Code Start
} kern;
